components:
  schemas:
    SeqDec:
      type: array
      items:
        type: double
    EnumStr:
      type: string
      enum:
      - a
      - b
      - c
    Bool:
      type: boolean
    MapStrToStr:
      type: object
      additionalProperties:
        type: string
    SeqSeqBool:
      type: array
      items:
        type: array
        items:
          type: boolean
    Dec:
      type: double
    SeqSeqStruct:
      type: array
      items:
        type: array
        items: {}
    EnumInt:
      type: string
      enum:
      - '0'
      - '1'
      - '2'
    SeqMapStrToDec:
      type: array
      items:
        type: object
        additionalProperties:
          type: double
    SeqRefBool:
      type: array
      items:
        $ref: '#/components/schemas/Bool'
    MapStrToStruct:
      type: object
      additionalProperties: {}
    SeqInt:
      type: array
      items:
        type: integer
        format: int64
    MapStrToMapStrToObj:
      type: object
      additionalProperties:
        type: object
        additionalProperties:
          type: object
          properties:
            int:
              type: integer
              format: int64
          required:
          - int
    Obj:
      type: object
      properties:
        var:
          type: string
      required:
      - var
    MapStrToSeqInt:
      type: object
      additionalProperties:
        type: array
        items:
          type: integer
          format: int64
    MapStrToRefObj:
      type: object
      additionalProperties:
        $ref: '#/components/schemas/Obj'
    SeqObj:
      type: array
      items:
        type: object
        properties:
          var:
            type: string
        required:
        - var
    Int:
      type: integer
      format: int64
    ObjWithSeq:
      type: object
      properties:
        var:
          type: array
          items:
            type: boolean
      required:
      - var
    Str:
      type: string
    SeqRefDec:
      type: array
      items:
        $ref: '#/components/schemas/Dec'
    Alias:
      $ref: '#/components/schemas/Str'
    MapStrToRefInt:
      type: object
      additionalProperties:
        $ref: '#/components/schemas/Int'
    MapStrToBool:
      type: object
      additionalProperties:
        type: boolean
    SeqBool:
      type: array
      items:
        type: boolean
    MapStrToInt:
      type: object
      additionalProperties:
        type: integer
        format: int64
    SeqStr:
      type: array
      items:
        type: string
    MapStrToDec:
      type: object
      additionalProperties:
        type: double
